        [bold]Процесс строительства.[/bold]

        Станцию достроили раньше срока. В связи с этим не успел подготовить все схроны. Тем не менее, на большинстве из них установлены раздвижные стены. Местоположение будет передано сразу после возвращения.


        [bold]Разведка.[/bold]

        В ходе разведовательной операции удалось узнать следующую информацию:


        Каждый офицер СБ, перед тем, как поступить на службу в НТ, проходит стажировку в ядерном подраздлелении синдиката. Только самые матёрые и опытные робасты имеют право сдать письменный экзамен ОЦК, и служить в СБ Кербероса. Каждый сотрудник обучен всем боевым искусствам в галактике, и умеет отличать их по одному нанесенному удару. Но не пользуется сам, потому что это ниже его достоинства. Каждый боец имеет в голове полную базу данных о всех прошлых и передовых разработках синдиката. Умеет пользоваться всей этой техникой, а также знает принципы противодействия ей. Осведомлен о всех способностях генокрадов. О всех возможностях пауков ужаса, ксеносов. Так же в него загружена полная база данных по снаряжению и заклинаниям любого мага федерации магов. 

        Но, к сожалению, в голове у сотрудников остается так мало места, что приходится удалять оттуда данные речевых функций, а так же все данные о КЗ, СРП и подобном, сразу после письменного экзамена. Итогом, сотрудник СБ становится молчаливым уберробастом, способным уничтожить любую угрозу в галактике.


        Не рекомендуется любое взаимодействие с сотрудниками данного отдела, а уж тем более качать права.
